import React, { Component } from 'react';
import { connect } from 'react-redux';



class BookView extends Component {
	render() {
		return (
			<div>
				book view
			</div>
		)
	}
}

function mapDispatchToProps(state){
	return {
		books:state.books
	}
}

export default connect(mapDispatchToProps)(BookView)
